import React, { Component } from 'react';
import { signOut } from "firebase/auth";
import { auth } from '../../firebase_config'

class Navbar extends Component {
    constructor(props){
        super(props);
    }
    signingOut(e){
        e.preventDefault();
        signOut(auth).then(() => {
          // Sign-out successful.
          console.log('bye')
          console.log(auth.currentUser)
          this.props.userchange(auth.currentUser);
        }).catch((error) => {
          // An error happened.
        });
    }
    render() {
        return (
            <div
            className='w-100 d-flex justify-content-end position-absolute'
            >
                <button className="btn btn-danger mx-5 my-4 rounded rounded-5" onClick={ this.signingOut }>    
                    Sign out {this.props.username}
                </button>
            </div>
        );
    }
}

export default Navbar;
